import React from 'react';

const TestingForm = (props) => {
    return (
        <form>
            <input 
                type="text" 
                placeholder="Enter Name"
                defaultValue="Emter"
                value={props.currentemploy}
                onChange={props.udateStatus}
            />
            {/* <input type="submit" value="Save"/> */}
        </form>
    )
}

export default TestingForm;
